import { useState } from "react";
import {
  TextField,
  Button,
  InputAdornment,
  Icon,
  IconButton,
} from "@mui/material";
import { css } from "@emotion/css";

const Signup = () => {
  const [showPassword, setShowPassword] = useState(false);
  const handleShowPasswordClick = () => {
    setShowPassword(!showPassword);
  };

  return (
    <div
      className={css`
        position: relative;
        border-radius: var(--br-5xl);
        background-color: var(--white-color);
        width: 100%;
        height: 56.25rem;
        overflow: hidden;
        display: flex;
        flex-direction: column;
        align-items: center;
        justify-content: center;
        text-align: left;
        font-size: 2.54rem;
        color: var(--white-color);
        font-family: var(--font-poppins);
      `}
    >
      <div
        className={css`
          box-shadow: 0px 4.2745561599731445px 4.27px rgba(0, 0, 0, 0.25);
          width: 90.57rem;
          height: 52.96rem;
          overflow: hidden;
          flex-shrink: 0;
          display: flex;
          flex-direction: row;
          align-items: center;
          justify-content: center;
          gap: 11.82rem;
        `}
      >
        <form
          className={css`
            position: relative;
            width: 26.85rem;
            height: 44.04rem;
          `}
        >
          <b
            className={css`
              position: absolute;
              top: -0.02rem;
              left: 8.91rem;
              font-size: 2.15rem;
              text-transform: uppercase;
              display: inline-block;
              font-family: var(--font-poppins);
              color: var(--color-black);
              text-align: left;
              width: 17.18rem;
              height: 5.08rem;
            `}
          >
            Sign up
          </b>
          <div
            className={css`
              position: absolute;
              top: 2.66rem;
              left: 3.87rem;
              font-size: 1.15rem;
              font-family: var(--font-poppins);
              color: var(--color-dimgray);
              text-align: left;
              display: inline-block;
              width: 16.63rem;
              height: 1.72rem;
            `}
          >
            Make An Account Right Away
          </div>
          <TextField
            className={css`
              border: none;
              background-color: transparent;
              position: absolute;
              top: 10.88rem;
              left: 0rem;
            `}
            sx={{ width: 417.3570556640625 }}
            color="secondary"
            variant="filled"
            type="text"
            label="Email-ID"
            placeholder="Placeholder"
            size="medium"
            margin="none"
            required
          />
          <TextField
            className={css`
              border: none;
              background-color: transparent;
              position: absolute;
              top: 6.23rem;
              left: 0rem;
            `}
            sx={{ width: 417.3570556640625 }}
            color="secondary"
            variant="filled"
            type="text"
            label="Full Name"
            placeholder="Placeholder"
            size="medium"
            margin="none"
            required
          />
          <TextField
            className={css`
              border: none;
              background-color: transparent;
              position: absolute;
              top: 15.54rem;
              left: 0rem;
            `}
            fullWidth
            color="secondary"
            variant="filled"
            type="text"
            label="Username"
            placeholder="Placeholder"
            size="medium"
            margin="none"
            required
          />
          <div
            className={css`
              position: absolute;
              top: 33.01rem;
              left: 0rem;
              width: 26.16rem;
              display: flex;
              flex-direction: column;
              align-items: flex-start;
              justify-content: flex-end;
            `}
          >
            <div
              className={css`
                align-self: stretch;
                border-radius: 18.35px;
                border: 1.1px solid var(--color-lavender);
                box-sizing: border-box;
                height: 3.78rem;
                display: flex;
                flex-direction: column;
                align-items: center;
                justify-content: center;
              `}
            >
              <div
                className={css`
                  width: 10.32rem;
                  height: 2.18rem;
                  display: flex;
                  flex-direction: row;
                  align-items: center;
                  justify-content: flex-start;
                  gap: 0.57rem;
                `}
              >
                <img
                  className={css`
                    position: relative;
                    width: 2.15rem;
                    height: 2.18rem;
                    object-fit: cover;
                  `}
                  alt=""
                  src="/google-1@2x.png"
                />
                <div
                  className={css`
                    position: relative;
                    font-size: 0.86rem;
                    color: var(--color-gray-200);
                    text-align: left;
                    display: inline-block;
                    width: 7.6rem;
                    height: 1.31rem;
                    flex-shrink: 0;
                  `}
                >
                  <span
                    className={css`
                      font-family: var(--font-poppins);
                    `}
                  >{`Login with `}</span>
                  <b
                    className={css`
                      font-family: var(--font-poppins);
                    `}
                  >
                    google
                  </b>
                </div>
              </div>
            </div>
            <div
